from typing import List

class Solution:
    def kClosest(self, points: List[List[int]], K: int) -> List[List[int]]:
        # k is less than number of points -return original array
        if K>=len(points):
            return points
        
        distMap = {}
        # Create hashmap or distances of all points.
        # Since numbers are integer, taking a square root won't matter, 
        # so we can avoid wasting processing time on it
        for x,y in points:
            dist = x*x+y*y
            if dist not in distMap:
                distMap[dist] = []
            distMap[dist].append([x,y])
        
        # Sort the array of keys of HashMap
        keyList = sorted(distMap)
        # Free some memory
        points = []
        
        # Go through the sorted array adding points to the result list
        for key in keyList:
            points.extend(distMap[key][:K-len(points)])
            if len(points) == K:
                break
                
        return points
        
        
